<style>
    body {
        background: #000000; 
        margin: 0;
        padding: 0;
        display: flex;
        justify-content: center;
        align-items: center;
        height: 100vh;
        width: 100vw;
        overflow: hidden; 
    }

    div.gm4html5_div_class {
        position: relative;
        width: 100%;
        height: 100%;
        overflow: hidden;
    }

    canvas {
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
        width: 100%;
        height: 100%;
        object-fit: contain; 
    }

    :-webkit-full-screen #canvas {
        width: 100%;
        height: 100%;
    }

     
    div.gm4html5_login {
        padding: 20px;
        position: absolute;
        border: solid 2px #000000;
        background-color: #404040;
        color: #00ff00;
        border-radius: 15px;
        box-shadow: #101010 20px 20px 40px;
    }

    div.gm4html5_cancel_button {
        float: right;
    }

    div.gm4html5_login_button {
        float: left;
    }

    div.gm4html5_login_header {
        text-align: center;
    }

     

    :-webkit-full-screen {
        width: 100%;
        height: 100%;
    }
</style>
